import { GoogleApiWrapper, Map, Marker } from "google-maps-react";
import React, { useState } from "react";
import Geocode from "react-geocode";

const GoogleMap = (props) => {
  console.log(props);

  const mapStyles = {
    width: "50%",
    height: "50%",
  };
  // Geocode.setApiKey("AIzaSyA9OU-Yxhjj-yocOCSzwPAOQpPnAOLJBj8");
  Geocode.enableDebug();

  // let x = Geocode.fromAddress("Eiffel Tower").then(
  //   (response) => {
  //     const { lat, lng } = response.results[0].geometry.location;
  //     console.log(lat, lng);
  //   },
  //   (error) => {
  //     console.error(error);
  //   }
  // );
  // console.log(x)

  let [latitude, setLatitude] = useState(-33.7560119);
  let [longitude, setLongitude] = useState(150.6038367);
  let [address, setAddress] = useState("canada");
  const handle = (e) => {
    e.preventDefault();
    const encodedAddress = encodeURI(address);
    fetch(
      `https://google-maps-geocoding.p.rapidapi.com/geocode/json?language=en&address=${encodedAddress}`,
      {
        method: "GET",
        headers: {
          "x-rapidapi-host": "google-maps-geocoding.p.rapidapi.com",
          "x-rapidapi-key": process.env.RAPIDAPI_KEY,
        },
      }
    )
      .then((response) => response.json())
      .then((response) => {
        setLatitude(response.lat);
        setLongitude(response.long);
      })
      .catch((err) => console.log(err));
  }
  
    
  console.log(latitude)
  console.log(longitude)

  return (
    <div>
      <Map
        google={props.google}
        zoom={8}
        style={mapStyles}
        initialCenter={{ lat: latitude, lng: longitude }}
      >
        <Marker position={{ lat: latitude, lng: longitude }} />
      </Map>
      <hr />
      <button onClick={handle}>click</button>
    </div>
  );
};

export default GoogleApiWrapper({
  apiKey: "AIzaSyA9OU-Yxhjj-yocOCSzwPAOQpPnAOLJBj8",
})(GoogleMap);
